package com.kriit.Util;

import static com.kriit.Util.WordContentExtractor.LOGGER;
import java.util.ArrayList;
import java.util.regex.Matcher;
import java.util.regex.Pattern;

/**
 *
 * @author Viral
 */
public class ContentExtractor {

    public static ArrayList<String> extractContent(String input, String regex) {
        LOGGER.info("Start ContentExtractor--->extractContent()");
        ArrayList<String> result = new ArrayList<>();
        if (!input.isEmpty()) {
            result = new ArrayList<>();
            Matcher m = Pattern.compile(regex).matcher(input);
            while (m.find()) {
                result.add(m.group());
            }
        }
        LOGGER.info("Extrcated Result Array Size:" + result != null ? result.size() : 0);
        LOGGER.info("Ends ContentExtractor--->extractContent()");
        return result;

    }

    public static void main(String[] args) {

        ArrayList<String> result = null;
        
        String WORD;
        WORD = "";
        WordContentExtractor we = new WordContentExtractor();
        String docString = we.getDocContent(WORD);
        
        //email [\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,3}
        result = extractContent(docString, "[\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,3}");
        if (result != null) {
            for (String r : result) {
                System.out.println(r);
            }
        }

        //Phone USA   \(?[\d]{3}\)?[\s-]?[\d]{3}[\s-]?[\d]{4}
        result = extractContent(docString, "((\\([\\d]{3}\\))|([\\d]{3}))[\\s-.]?((\\([\\d]{3}\\))|([\\d]{3}))[\\s-.]?((\\([\\d]{4}\\))|([\\d]{4}))");
        if (result != null) {
            for (String r : result) {
                System.out.println(r);
            }
        }

        
        
        
        String PDF = "";
        PDFContentExtractor pe = new PDFContentExtractor();
        String pdfString = pe.getPDFContent(PDF);
        //email [\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,3}
        result = extractContent(pdfString, "[\\w-\\.]+@([\\w-]+\\.)+[\\w-]{2,3}");
        if (result != null) {
            for (String r : result) {
                System.out.println(r);
            }
        }
       
        //Phone USA   \(?[\d]{3}\)?[\s-]?[\d]{3}[\s-]?[\d]{4}
        result = extractContent(pdfString, "((\\([\\d]{3}\\))|([\\d]{3}))[\\s-.]?((\\([\\d]{3}\\))|([\\d]{3}))[\\s-.]?((\\([\\d]{4}\\))|([\\d]{4}))");
        if (result != null) {
            for (String r : result) {
                System.out.println(r);
            }
        }
        

    }

}
